INSERT INTO `serie` (`id`, `titolo`, `genere`, `stagioni`, `autore`, `attore1`, `personaggio1`, `attore2`, `personaggio2`, `attore3`, `personaggio3`, `trama`, `copertina`) VALUES
	(1, 'Stranger Things', 'Fantascienza', 3, 'Matt Duffer', 'Winona Ryder', 'Joyce Byers', 'David Harbour', 'Jim Hopper', 'Finn Wolfhard', 'Mike Wheeler', 'La giovane Eleven (Undici), che viene soprannominata El dai suoi nuovi amici, non e\' di molte parole e non ha mai visto il mondo. Ben presto si scopre infatti che e\' fuggita da un laboratorio segreto, dove il suo stesso padre conduceva esperimenti su di lei per via delle sue capacita\'. Episodi molto strani continuano ad accadere nella serie tv, come la comparsa di mostri senza volto, per culminare con la sparizione di un\'altra ragazza.', _binary ),
	(2, 'Breaking Bad', 'Drammatico', 5, 'Vince Gilligan', 'Bryan Cranston', 'Walter White', 'Aaron Paul', 'Jesse Pinkman', 'Anna Gunn', 'Skyler White', 'Walter White e\' un professore di chimica di Albuquerque che vive con la moglie Skyler, incinta della loro secondogenita, e il figlio Walter "Flynn" Junior, affetto da una paralisi cerebrale, un disturbo che gli causa problemi di linguaggio e lo costringe a servirsi di stampelle per muoversi. Alla soglia dei cinquant\'anni, Walter e\' costretto a svolgere un secondo lavoro come dipendente di un autolavaggio, per far fronte alle difficolta\' economiche della famiglia.', _binary ),
	(3, 'Tredici', 'Drammatico', 3, 'Bryan Yorkey', 'Dylan Minnette', 'Clay Jensen', 'Katerine Langford', 'Hannah Baker', 'Christian Navarro', 'Tony Padilla', 'La Liberty High School, liceo di una piccola cittadina americana, e\' sconvolta dal recente suicidio della studentessa Hannah Baker, tagliatasi le vene qualche settimana prima. Clay Jensen, anch\'esso studente della Liberty High, tornando a casa trova una scatola sulla veranda al cui interno ci sono sette cassette registrate dalla stessa Hannah, in cui spiega le tredici ragioni che l\'hanno spinta a togliersi la vita. Clay capisce cosi\' di avere a che fare con questa storia e inizia l\'ascolto dei nastri. Emerge ben presto come Clay sia stato uno dei tredici motivi. La stagione si chiude con la registrazione da parte di Clay di una confessione da parte di Bryce, il quale dichiara di aver stuprato Hannah, episodio gia\' narrato da Hannah all\'interno della dodicesima cassetta. All\'interno poi della tredicesima si scopre che la scuola avrebbe potuto intervenire e salvare Hannah, ma si e\' tirata indietro, spingendola a togliersi la vita.', _binary ),
	(4, 'Elite', 'Thriller', 2, 'Carlos Montero', 'Maria Pedraza', 'Marina Nunier', 'Itzan Escamilla', 'Samuel Garcia', 'Miguel Bernardeau', 'Guzman Nunier', 'La serie segue la vita di tre giovani di umili origini: si tratta di Samuel, Nadia e Christian, che hanno ricevuto una borsa di studio per frequentare Las Encinas, un prestigioso istituto spagnolo. L\'arrivo dei tre non sara\' pero\' facile, perche\' i viziati studenti che si trovano nella scuola non renderanno loro semplice la vita. Tra l\'umiliazione e il bullismo si verifica poi l\'omicidio di uno dei ragazzi della scuola. Ed e\' da questo assassinio che la narrazione ha inizio.', _binary ),
	(5, 'Orange is the new black', 'Commedia', 7, 'Jenji Kohan', 'Taylor Schilling', 'Piper Chapman', 'Luara Prepon', 'Alex Vause', 'Micheal Harney', 'Sam Healy', 'Piper Chapman e\' una donna proveniente dal Connecticut, residente a New York, che viene condannata a scontare quindici mesi di detenzione al Litchfield, un carcere femminile federale gestito dal Dipartimento Federale di Correzione, per un fatto avvenuto dieci anni prima, quando aveva trasportato una valigia piena di soldi di provenienza illecita per conto di Alex Vause, una trafficante internazionale di droga della quale un tempo era amante. Durante il processo a suo carico e prima della condanna, la Chapman era riuscita a costruirsi una vita agiata, rispettosa della legge, nell\'alta borghesia newyorkese con il suo nuovo fidanzato Larry Bloom.', _binary ),
	(6, 'Carlos', 'Biografico', 1, 'Olivier Assayas', 'Edgar Ramirez', 'Carlos lo Sciacallo', 'Alexander Scheer', 'Johannes Weinrich', 'Susanne Wuest', 'Edit Heller', 'Carlos e\' una miniserie televisiva di genere biografico del 2010, di produzione franco-tedesca. E\' stata ideata, scritta e diretta da Olivier Assayas, ed e\' basata sulla vita di Ilich Ramirez Sanchez, detto Carlos, un terrorista marxista e mercenario venezuelano, dai primi attentati nel 1973 fino al suo arresto nel 1994.\r\n', _binary ),
	(7, 'Trust', 'Biografico', 1, 'Simon Beaufoy', 'Donal Sutherland', 'J.Paul Getty', 'Hilary Swank', 'Gail Getty', 'Harris Dickynson', 'John Paul Getty', 'John Paul Getty III, erede dell\'impero petrolifero Getty, viene rapito dalla mafia. La famiglia e\' intenzionata a pagare il riscatto ma il nonno Paul, enigmatico magnate, si rifiuta di assecondare le loro richieste.', _binary );
INSERT INTO `serie` (`id`, `titolo`, `genere`, `stagioni`, `autore`, `attore1`, `personaggio1`, `attore2`, `personaggio2`, `attore3`, `personaggio3`, `trama`, `copertina`) VALUES
	(8, 'Il trono di spade', 'Thriller', 8, 'David Benioff', 'Sean Bean', 'Eddard Stark', 'Mark Addy', 'Robert Baratheaon', 'Peter Dynklage', 'Tyron Lannister', 'La serie racconta le avventure di molti personaggi ed e\' ambientata in un grande mondo immaginario costituito principalmente dal continente Occidentale (Westeros) e da quello Orientale (Essos). Il centro piu\' grande e civilizzato del continente Occidentale e\' la citta\' capitale Approdo del Re, dove si trova il Trono di Spade dei Sette Regni. La lotta per la conquista del trono porta le piu\' potenti e nobili famiglie del continente a scontrarsi o allearsi tra loro in un contorto gioco di potere, che coinvolge anche l\'ultima discendente della dinastia regnante deposta. Gli intrighi politici, economici e religiosi dei nobili lasciano la popolazione nella poverta\' e nel degrado, mentre il mondo viene minacciato dall\'arrivo di un inverno diverso dai precedenti, che risveglia creature leggendarie dimenticate e fa emergere forze oscure e magiche.\r\n', _binary ),
	(9, 'How I meet your mother', 'Commedia', 9, 'Carter Bays', 'Josh Radnor', 'Ted Mosby', 'Jason Segel', 'Marshall Eriksen', 'Cobie Smulders', 'Robin Scherbatsky', 'La serie racconta le vicissitudini sociali e sentimentali dei cinque amici Ted, Marshall, Robin, Barney e Lily nella New York d\'inizio III millennio. All\'interno di una cornice narrativa ambientata nel futuro, la trama principale e\' costituita dalla ricerca, da parte di Ted, dell\'anima gemella con cui sposarsi e metter su famiglia; accanto a lui si snodano le vicende dei giovani innamorati Marshall e Lily, del donnaiolo Barney e di Robin, molto piu\' di un\'amica per Ted.\r\n', _binary ),
	(10, 'Doctor Who', 'Fantascienza', 26, 'Sydney Newman', 'Jodie Whittaker', 'Tredicesimo Dottore', 'Pearl Mackie', 'Bill Potts', 'Billie Piper', 'Rose Tyler', 'La serie narra delle avventure del Dottore, un viaggiatore del tempo e dello spazio, e delle sue compagne e compagni a bordo del Tardis. Egli e\' l\'ultimo Signore del Tempo, razza aliena proveniente dal pianeta Gallifrey e si ritrova a combattere contro malvagi alieni per salvare l\'universo dalla precoce distruzione, tra cui i mortali nemici, i Dalek, distruttori del suo pianeta natio e della sua razza.\r\n', _binary ),
	(11, 'Lovesick', 'Romantico', 3, 'Tom Edge', 'Johnny Flynn', 'Dylan Witter', 'Antonia Thomas', 'Evie', 'Daniel Ings', 'Luke', 'A Dylan Witter (Johnny Flynn) viene diagnosticata la clamidia, cosi\' e\' costretto a contattare tutte le sue ex-ragazze per informarle della malattia. I migliori amici di Dylan sono Luke (Daniel Ings) e Evie (Antonia Thomas), che ha avuto per anni una cotta per Dylan e che sta per sposare un altro uomo. In ogni episodio, intitolato con il nome di una delle ex, Dylan ricorda tutti gli eventi legati a una sua particolare ex.\r\n', _binary ),
	(12, 'Gossip Girl', 'Romantico', 6, 'Josh Schwartz', 'Blake Lively', 'Serena Wan Der Woodsen', 'Leighton Meester', 'Blair Waldorf', 'Ed Westwick', 'Chuck Bass', 'Serena van der Woodsen torna inaspettatamente nell\'Upper East Side dal collegio per il quale era partita improvvisamente l\'anno prima senza dare spiegazioni a nessuno, neanche alla sua migliore amica Blair Waldorf. Quest\'ultima, arrabbiata per non aver piu\' ricevuto notizie di Serena dalla sua partenza e per non aver avuto nessuno con cui confidarsi in merito ai suoi problemi familiari, non e\' contenta del ritorno di Serena e cerca di tagliarla fuori dalla cerchia di vecchie conoscenze nel timore che possa riprendersi il titolo di regina della Constance Billard, la loro scuola, conquistato nell\'ultimo anno proprio grazie all\'assenza di Serena, da sempre piu\' popolare di lei. Il contrasto tra le due ex amiche si fa piu\' aspro quando Blair scopre che, prima di lasciare New York, Serena e\' andata a letto con il suo ragazzo, Nate Archibald, ma le due riescono a superare la cosa quando Blair confida all\'amica quello che ha provato negli ultimi mesi e Serena le confessa di essere tornata perche\' il fratello minore Eric, ha tentato il suicidio.', _binary ),
	(13, 'Lost', 'Avventura', 6, 'J. J. Abrams', 'Naven Andrews', 'Sayid Jarrah', 'Emilie de Ravin', 'Claire Littleton', 'Matthew Fox', 'Jack Shephard', 'Il 22 settembre 2004 l\'aereo di linea 815 della compagnia australiana Oceanic Airlines, in volo da Sydney a Los Angeles, precipita su un\'isola apparentemente disabitata. I 48 sopravvissuti si accampano sulla spiaggia e si organizzano per resistere fino all\'arrivo dei soccorsi, che pero\' tardano ad arrivare. Ma, ben presto, scoprono che il loro aereo e\' uscito dalla rotta prevista di circa mille miglia e che l\'isola e\' teatro di una serie di eventi apparentemente inspiegabili. Nel tentativo di trovare un modo per fuggire, si renderanno conto che altre persone, prima di loro, sono naufragate su quell\'isola e probabilmente sono ancora li\'. Contemporaneamente, iniziano a nascere amicizie e tensioni tra i vari superstiti, le cui storie personali celano molti segreti, con cui saranno costretti a confrontarsi, date le presenze misteriose intorno a loro, gli altri.\r\n', _binary ),
	(14, 'Crusoe', 'Avventura', 1, 'Stephen Gallagher', 'Philip Winchester', 'Robinson Crusoe', 'Tongayi Chirisa', 'Venerdi\'', 'Joaquim de Almeida', 'Santos Santana', 'La serie segue le avventure di Robinson Crusoe, un uomo naufragato su un\'isola che per sei anni tenta disperatamente di tornare a casa dalla moglie e dai figli. Il suo compagno e\' Venerdi\', un indigeno che Robinson salvo\' dai cannibali, a cui ha insegnato la lingua inglese, ad imparare le Sacre Scritture, a leggere la Bibbia, a mangiare e bere.\r\n', _binary ),
	(15, 'Vikings', 'Azione', 5, 'Michel Hirst', 'Travis Fimmel', 'Ragnar', 'Katheryn Winnik', 'Lagherta', 'Alexander Lugwig', 'Bjorn', 'La serie, ambientata nel IX secolo tra la Scandinavia e le isole britanniche, racconta in chiave romanzata le avventure del guerriero vichingo Ragnarr Lotbrok, interpretato dall\'attore australiano Travis Fimmel, e di altri personaggi storici come Lagertha, Rollone, Hrafna-Floki Vilgerdarson, Aelle II di Northumbria, Aslaug Sigurdsdottir, Bjorn Ragnarsson, Egberto del Wessex, Horik I, Harald I di Norvegia, Halfdan il Nero, Ivarr Ragnarsson, Etelvulfo del Wessex e Alfredo il Grande.', _binary ),
	(16, 'Scream', 'Horror', 3, 'Jill Blotevogel', 'Willa Fitzgerald', 'Emma Duval', 'Bex Taylor', 'Audrey Jensen', 'John Karna', 'Noah Foster', 'A Lakewood, una ragazza, Nina Patterson, viene brutalmente assassinata insieme al suo ragazzo. La polizia, che inizialmente rinviene solo il cadavere di lei, pensa ad un delitto passionale, ma presto dovra\' ricredersi quando anche altri coetanei della giovane iniziano ad essere vittime di stalking, per poi essere uccisi. Gli omicidi compiuti da un killer che indossa una maschera post-operatoria, sembrano ripercorrere quelli di Brandon James, che vent\'anni prima, dopo essere stato vittima di bullismo a causa delle sue deformazioni fisiche ed essere stato rifiutato dalla ragazza dalla quale era ossessionato, Daisy, uccise diversi coetanei. Daisy, ora madre single di Emma, ha cercato di dimenticare le vicende che l\'hanno coinvolta, cambiando nome in Margaret. L\'omicida tuttavia comincia presto a perseguitare Emma ed i suoi amici.\r\n', _binary ),
	(17, 'The Hauntig', 'Horror', 1, 'Mike Flanagan', 'Michiel Huisman', 'Steven Crain', 'Carla Gugino', 'Olivia Crain', 'Henry Thomas', 'Hugh Crain', 'La serie racconta la storia di un gruppo di fratelli che, da bambini, trascorrono un\'estate in quella che in seguito sarebbe diventata la casa infestata piu\' famosa del paese. Ora adulti e costretti a stare di nuovo insieme di fronte alla tragedia, la famiglia deve finalmente affrontare i fantasmi del loro passato, alcuni dei quali sono ancora in agguato nelle loro menti, mentre altri potrebbero nascondersi nell\'ombra.', _binary );
INSERT INTO `serie` (`id`, `titolo`, `genere`, `stagioni`, `autore`, `attore1`, `personaggio1`, `attore2`, `personaggio2`, `attore3`, `personaggio3`, `trama`, `copertina`) VALUES
	(18, 'Daredevil', 'Azione', 3, 'Drew Goddard', 'Charlie Cox', 'Matt Murdock', 'Deborah Ann Woll', 'Karen Page', 'Elden Henson', 'Franklin "Foggy" Nelson', 'Hell\'s Kitchen. L\'avvocato Matt Murdock, dopo aver perso la vista da bambino a causa di un incidente radioattivo, sviluppa dei sensi sovrumani e li utilizza per combattere il crimine per le strade della sua citta\' nei panni del supereroe Daredevil. Nella prima stagione Matt affronta il potente signore del crimine Wilson Fisk, alias Kingpin, impegnato nella sua opera di riqualificazione del quartiere in combutta con vari esponenti della malavita della citta\'. Nella seconda stagione Matt continua a cercare di gestire la sua doppia vita come avvocato e supereroe; il suo cammino lo porta ad incrociarsi con il freddo, violento e spietato vigilante Frank Castle, alias The Punisher, e con la sua vecchia fiamma Elektra, assieme alla quale affronta un\'antica e potente setta ninja, la Mano. Nella terza stagione, Daredevil dovra\' affrontare ancora Wilson Fisk, che prova a risalire la china e ricostruire il suo regno criminale.', _binary ),
	(19, 'Steins;Gate', 'Animazione', 1, 'Hiroshi Hamasaki', 'Micheal Tatum', 'Rintaro Okabe', 'Trina Nishimura', 'Kurisu Makise', 'Ashly Burch', 'Mayuri Shiina', 'Steins; Gate e\' un adattamento dell\'omonimo videogioco. E\' ambientato nel 2010 ad Akihabara, a Tokyo, e segue Rintaro Okabe, un autoproclamato "scienziato pazzo", che gestisce il "Future Gadget Laboratory" in un appartamento insieme ai suoi amici Mayuri Shiina e Itaru "Daru" Hashida. Durante una conferenza sul viaggio nel tempo, Okabe trova il cadavere di Kurisu Makise, una neuroscienzaricercatore iinvia un messaggio a riguardo a Daru, e in seguito scopre che Kurisu e\' vivo e che il messaggio e\' arrivato prima di inviarlo. I membri del laboratorio apprendono che il forno a microonde cellulare che stanno sviluppando puo\' inviare messaggi di testo indietro nel tempo; si uniscono a Kurisu e lo studiano, inviando messaggi di testo - detti "D-mail" - al passato per cambiare il presente. Kurisu alla fine crea un dispositivo in grado di inviare ricordi attraverso il forno a microonde, permettendo cosi\' all\'utente di viaggiare nel tempo.', _binary ),
	(20, 'Kill la Kill', 'Animazione', 3, 'Hiroyuki Imaishi', 'Lucrezia Marricchi', 'Ryuko Matoi', 'Massimo De Ambrosis', 'Senketsu', 'Monica Vulcano', 'Satsuki Kiryuin', 'Kill la Kill e\' ambientato nell\'Istituto Honnoji, un liceo immaginario situato dalle parti della baia di Tokyo in Giappone. La scuola e\' dominata dal suo temibile consiglio studentesco, diretto a sua volta da Satsuki Kiryuin, e i suoi studenti indossano particolari uniformi, chiamate ultra uniformi, che li dotano di abilita\' sovrumane grazie alle cosiddette biofibre da guerra, cioe\' il materiale di cui sono fatte. Ryuko Matoi, una studentessa in possesso di una spada a forma di forbice capace di tagliare le ultra uniformi, si trasferisce nell\'Istituto in cerca dell\'assassina di suo padre e, dopo aver affrontato il consiglio studentesco, riesce a malapena a darsi alla fuga. Non sapendo cosa fare, Ryuko a questo punto si imbatte in un\'uniforme alla marinara che nomina Senketsu e che le si mette addosso, facendola diventare talmente forte da poter affrontare sia Satsuki stessa sia le sue prove e ostacoli. Nel frattempo, la ragazza fa amicizia con una compagna di studi di nome Mako Mankanshoku, e va a vivere con la sua famiglia nei bassifondi intorno all\'Istituto.', _binary );
